import React, { useState, useEffect } from 'react';
// import "./App.css";
export const RollTrailerManagementSystemSearch = () => {
    const itemList = [
        "Apple",
        "Orange",
        "Banana",
        "Cherry",
        "Milk",
        "Peanuts",
        "Butter",
        "Tomato"
      ];

      const [filteredList, setFilteredList] = new useState(itemList);

      return (
        <div id="item-list">
           <ol>
             {filteredList.map((item, index) => (
                <li key={index}>{item}</li>
             ))}
           </ol>
        </div>
    )
}
